	/*
	 * 将Y16数据转换成Y8数据
	 */
	void	Map16BitTo8Bit_u(unsigned short *psh16BitData, long lDataLen, unsigned char* pby8BitData, int nBrightness, int nContrast)
	{
		if (psh16BitData == NULL || pby8BitData == NULL || lDataLen <= 0)
		{
			return;
		}

		//指向直方图的数据指针
		int pHist[65536] = { 0 };
		memset(pHist, 0, 65536 * sizeof(int));

		int i = 0;
		for (i = 0; i < lDataLen; i++)
		{
			pHist[psh16BitData[i]]++;
		}

		//设置阈值大小为: AreaSigma*图象大小/100
		int nSigma = 3 * 768;
		int nSum = 0;
		int nMin = 0;
		int nMax = 0;

		//求映射的最大最小值	
		for (i = 0; i < 65536; i++)
		{
			nSum += pHist[i];
			if (nSum >= nSigma)
			{
				nMin = i;
				break;
			}
		}

		nSum = 0;
		for (i = 65535; i >= 0; i--)
		{
			nSum += pHist[i];
			if (nSum >= nSigma)
			{
				nMax = i;
				break;
			}
		}

		nBrightness = (nBrightness > 100) ? 100 : nBrightness;
		nBrightness = (nBrightness < 0) ? 0 : nBrightness;

		nContrast = (nContrast > 100) ? 100 : nContrast;
		nContrast = (nContrast < 0) ? 0 : nContrast;

		//计算对比度亮度
		float K = (float)(256.0 / (nMax - nMin + 1)) * float(nBrightness / 100.0);
		float C = (float)(-K * nMin) * float(nContrast / 100.0);

		//图像映射
		for (i = 0; i < lDataLen; i++)
		{
			int nValue = (int)(K * psh16BitData[i] + C);
			if (nValue < 0)
			{
                pby8BitData[i] = 0;
			}
			else if (nValue > 255)
			{
                pby8BitData[i] = 255;
			}
			else
			{
                pby8BitData[i] = nValue;
			}
		}
	}

	/*
	 * 将Y16数据转换成Y8数据
	 */
	void	Map16BitTo8Bit(short* psh16BitData, int nDataLen, unsigned char* pby8BitData, int nBrightness, int nContrast)
	{
		if (NULL == psh16BitData || NULL == pby8BitData || nDataLen <= 0)
		{
			return;
		}

		//指向直方图的数据指针
		int pHist[65536] = { 0 };
		memset(pHist, 0, sizeof(pHist));

		int i = 0;
		for (i = 0; i < nDataLen; i++)
		{
			pHist[psh16BitData[i] + 32768]++;
		}

		//设置阈值大小为: AreaSigma*图象大小/100
		int nSigma = 3 * 768;
		int nSum = 0;
		int nMin = 0;
		int nMax = 0;

		//求映射的最大最小值	
		for (i = 0; i < 65536; i++)
		{
			nSum += pHist[i];
			if (nSum >= nSigma)
			{
				nMin = i - 32768;
				break;
			}
		}

		nSum = 0;
		for (i = 65535; i >= 0; i--)
		{
			nSum += pHist[i];
			if (nSum >= nSigma)
			{
				nMax = i - 32768;
				break;
			}
		}

		nBrightness = (nBrightness > 100) ? 100 : nBrightness;
		nBrightness = (nBrightness < 0) ? 0 : nBrightness;

		nContrast = (nContrast > 100) ? 100 : nContrast;
		nContrast = (nContrast < 0) ? 0 : nContrast;

		//计算对比度亮度
		float K = (float)(256.0 / (nMax - nMin + 1)) * float(nBrightness / 100.0);
		float C = (float)(-K * nMin) * float(nContrast / 100.0);

		//图像映射
		for (i = 0; i < nDataLen; i++)
		{
			int nValue = (int)(K * psh16BitData[i] + C);
			if (nValue < 0)
			{
                pby8BitData[i] = 0;
			}
			else if (nValue > 255)
			{
                pby8BitData[i] = 255;
			}
			else
			{
                pby8BitData[i] = nValue;
			}
		}
	}

