	void Flip(unsigned char *pImgData, long lWidth, long lHeight, unsigned char byPixelByteCount)
	{
		long lWidthByteCount = lWidth * byPixelByteCount;//每行的字节数
		unsigned char *pTempData = new unsigned char[lWidthByteCount];

		//每两行进行交换
		for (int i = 0; i < lHeight / 2; i++)
		{
			memcpy(pTempData, pImgData + i * lWidthByteCount, lWidthByteCount);
			memcpy(pImgData + i * lWidthByteCount, pImgData + (lHeight - i - 1) * lWidthByteCount, lWidthByteCount);
			memcpy(pImgData + (lHeight - i - 1) * lWidthByteCount, pTempData, lWidthByteCount);
		}

		delete pTempData;
	}

	void Mirror(unsigned char *pImgData, long lWidth, long lHeight, unsigned char byPixelByteCount)
	{
		long lWidthByteCount = lWidth * byPixelByteCount;//每行的字节数
		unsigned char *pTempData = new unsigned char[byPixelByteCount];

		//每两列进行交换
		for (int i = 0; i < lHeight; i++)
		{
			for (int j = 0; j < lWidth / 2; j++)
			{
				memcpy(pTempData, pImgData + i * lWidthByteCount + j * byPixelByteCount, byPixelByteCount);
				memcpy(pImgData + i * lWidthByteCount + j * byPixelByteCount,
					pImgData + i * lWidthByteCount + (lWidth - j - 1) * byPixelByteCount, byPixelByteCount);
				memcpy(pImgData + i * lWidthByteCount + (lWidth - j - 1) * byPixelByteCount,
					pTempData, byPixelByteCount);
			}
		}

		delete pTempData;
	}

	void FlipAndMirror(unsigned char *pImgData, long lWidth, long lHeight, unsigned char byPixelByteCount)
	{
		//上下反转
		Flip(pImgData, lWidth, lHeight, byPixelByteCount);

		//镜像变换
		Mirror(pImgData, lWidth, lHeight, byPixelByteCount);
	}


